import styled from "styled-components";

export const Container = styled.div`
width: 500px;
height: 500px;
background-color: #e4e4e4;
border-radius: 5px;
display: flex;
flex-direction: column;
padding: 30px;

`

export const LogoContainer = styled.div`
  width: 100%;
  height: 45px;

  img {
    width: 100%;
  }
`;
